function App() {
 return (
    <div className="App">
      <BrowserRouter>
          <div>
            <Switch>
              <Route path='/home' >
                <HomeComponent/>
              </Route>
            </Switch>
            {/*<MainComponent />*/}
          </div>    
      </BrowserRouter>
    </div>
  );
}

export default App;
